%[text] ## Import Data
thisFilePath = matlab.desktop.editor.getActiveFilename;
[thisFolder, ~, ~] = fileparts(thisFilePath);

rootFolder = fileparts(thisFolder);

powerDataPath = fullfile(rootFolder, 'data', 'ErcotPowerDemand.csv');
windDataPath = fullfile(rootFolder, 'data', 'interpolated_data.csv');


windOpts = detectImportOptions(windDataPath);
powerOpts = detectImportOptions(powerDataPath);
windData = readtable(windDataPath, windOpts) %[output:7f6ac059]
powerData = readtable(powerDataPath, powerOpts) %[output:8d5123b4]




turbinesByCase =  [ 37.1505*1.0; % case 1    Primary reliance on wind %[output:group:38cc51c4] %[output:5260768b]
                    37.1505*0.9; % case 2 %[output:5260768b]
                    37.1505*0.8; % case 3 %[output:5260768b]
                    37.1505*0.7; % case 4 %[output:5260768b]
                    37.1505*0.6; % case 5 %[output:5260768b]
                    37.1505*0.5; % case 6 %[output:5260768b]
                    37.1505*0.4; % case 7  %[output:5260768b]
                    37.1505*0.3; % case 8 %[output:5260768b]
                    37.1505*0.2; % case 9 %[output:5260768b]
                    37.1505*0.1; % case 10 %[output:5260768b]
                    37.1505*0.0; % case 11    Primary reliance on H2 %[output:5260768b]
                    ] %[output:group:38cc51c4] %[output:5260768b]

numTurbines = turbinesByCase(3) %[control:slider:7c7f]{"position":[30,31]} %[output:3b6c541f]

windTimestamp                       = windData.TIMESTAMP;
hoursFromZero                       = windData.HOURS_FROM_ZERO;
% interval                          = windData.INTERVAL;
windSpeed                           = windData.WIND_SPEED;
windSpeedAtHeight                   = windData.WIND_SPEED_AT_HEIGHT;
windSpeedRounded                    = windData.WIND_SPEED_ROUNDED;  
powerGenerated_kW                    = windData.POWER_OUTPUT_kW * numTurbines;
% energyGeneratedInterval_kWh       = windData.ENERGY_GENERATED_INTERVAL_kWh;
energyGeneratedTotal_kWh            = windData.TOTAL_ENERGY_kWh * numTurbines;
        
        
powerTimestamp                      = powerData.TIMESTAMP;
powerConsumed_mW                    = powerData.SCENT;
powerConsumedUnreduced_kW           = powerConsumed_mW * 1000; % convert from MW to kW and then reduce load by a factor of 1000 to make numbers more digestible 
powerConsumed_kW                    = powerConsumed_mW * 1000/1000;
energyConsumedIntervalUnreduced_kWh = powerConsumed_kW * 1;
energyConsumedTotalUnreduced_kWh    = powerData.SCENT_TOTAL_ENERGY_kWh;
energyConsumedInterval_kWh          = powerConsumed_kW * 1/1000;
energyConsumedTotal_kWh             = powerData.SCENT_TOTAL_ENERGY_kWh/1000;




windDates  = datetime(windTimestamp, 'InputFormat', 'yyyy-MM-dd'' ''HH:mm:ss');
powerDates = datetime(powerTimestamp, 'InputFormat', 'yyyy-MM-dd'' ''HH:mm:ss');
%%
%[text] ## Wind Speed Graph
figure; %[output:571c548c]
hold on %[output:571c548c]
plot(windDates, windSpeedAtHeight) %[output:571c548c]
xlabel("date") %[output:571c548c]
ylabel("wind speed (m/s)") %[output:571c548c]
title("Speed at time"); %[output:571c548c]
hold off %[output:571c548c]
%%
%[text] ## Wind Power Graph
figure; %[output:53493e9d]
hold on %[output:53493e9d]
plot(windDates, powerGenerated_kW) %[output:53493e9d]
xlabel("date") %[output:53493e9d]
ylabel("power produced (kW)") %[output:53493e9d]
title("Instantaneous Power Produced"); %[output:53493e9d]
hold off %[output:53493e9d]
%%
%[text] ## Wind Total Energy Graph
figure; %[output:903adc40]
hold on %[output:903adc40]
plot(windDates, energyGeneratedTotal_kWh) %[output:903adc40]
xlabel("date") %[output:903adc40]
ylabel("total energy produced (kWh)") %[output:903adc40]
title("Total Energy Generated During 2025"); %[output:903adc40]
hold off %[output:903adc40]
%%
%[text] ## Consumption Power Graph
figure; %[output:9c66ab9b]
hold on %[output:9c66ab9b]
plot(powerDates, powerConsumed_kW) %[output:9c66ab9b]
xlabel("date") %[output:9c66ab9b]
ylabel("power consumed (kW)") %[output:9c66ab9b]
title("Instantatenous Power Consumed"); %[output:9c66ab9b]
hold off %[output:9c66ab9b]
%%
%[text] ## Consumption Energy Graph
figure; %[output:30e95d55]
hold on %[output:30e95d55]
plot(powerDates, energyConsumedTotal_kWh) %[output:30e95d55]
xlabel("date") %[output:30e95d55]
ylabel("total energy consumed (kWh)") %[output:30e95d55]
title("Total Energy Consumed During 2025"); %[output:30e95d55]
hold off %[output:30e95d55]
%%
%[text] ## Surplus/Difecit Power
surplusPower = powerGenerated_kW - powerConsumed_kW %[output:8b3b046b]
figure; %[output:5732fe49]
hold on %[output:5732fe49]
plot(powerDates, surplusPower) %[output:5732fe49]
yline(0, 'color', "white") %[output:5732fe49]
xlabel("date") %[output:5732fe49]
ylabel("instantaneous surplus power (kWh)") %[output:5732fe49]
title("Surplus/Deficit Power for 2025"); %[output:5732fe49]
hold off %[output:5732fe49]
%%
%[text] ## Surplus/Deficit Energy
surplusEnergy = energyGeneratedTotal_kWh - energyConsumedTotal_kWh;
figure; %[output:4669f728]
hold on %[output:4669f728]
plot(powerDates, surplusEnergy) %[output:4669f728]
yline(0, 'color', "white") %[output:4669f728]
xlabel("date") %[output:4669f728]
ylabel("surplus energy (kWh)") %[output:4669f728]
title("Surplus/Deficit Energy for 2025"); %[output:4669f728]
hold off %[output:4669f728]

%%
%[text] ## Calculate Required Number of Turbines for each Case
maxPowerConsumed = max(powerConsumed_kW) %[output:0c92eb86]
averagePowerProduced = mean(powerGenerated_kW) %[output:94acb7be]

